import React, { useState } from 'react';
import axios from 'axios';
import { FaSearch, FaUser, FaPhone, FaEnvelope, FaDog, FaClock, FaCalendarAlt, FaClipboardList } from 'react-icons/fa';
import styles from './FindVetAppointments.css';

const FindVetAppointments = () => {
    const [userID, setUserID] = useState('');
    const [appointments, setAppointments] = useState([]);
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);

    const handleInputChange = (e) => {
        setUserID(e.target.value);
    };

    const fetchAppointments = async () => {
        if (!userID) {
            setError('Please enter a valid user ID.');
            return;
        }

        setLoading(true);
        setError('');

        try {
            const response = await axios.get(`http://localhost:8800/api/vet/findVetAppointments/${userID}`);
            if (response.data.length > 0) {
                setAppointments(response.data);
            } else {
                setError('No appointments found for this veterinarian.');
                setAppointments([]);
            }
        } catch (err) {
            console.error('Error fetching appointments:', err);
            setError('Failed to retrieve appointments. Please try again later.');
            setAppointments([]);
        }

        setLoading(false);
    };

    return (
        <div className={styles.findVetAppointments}>
            <div className={styles.container}>
                <h2 className={styles.title}>Find Vet Appointments</h2>
                <div className={styles.formGroup}>
                    <label htmlFor="userID" className={styles.label}>Enter Your User ID:</label>
                    <div className={styles.inputContainer}>
                        <input
                            type="text"
                            id="userID"
                            value={userID}
                            onChange={handleInputChange}
                            className={styles.input}
                            placeholder="Enter user ID"
                        />
                        <button onClick={fetchAppointments} disabled={loading} className={styles.button}>
                            {loading ? 'Loading...' : <FaSearch />}
                        </button>
                    </div>
                </div>

                {error && <p className={styles.error}>{error}</p>}

                {appointments.length > 0 && (
                    <div className={styles.appointmentsList}>
                        <h3 className={styles.subTitle}>Your Appointments</h3>
                        <div className={styles.cardContainer}>
                            {appointments.map((appointment) => (
                                <div key={appointment.appointmentID} className={styles.card}>
                                    <h4 className={styles.cardTitle}><FaDog /> {appointment.petName}</h4>
                                    <p><FaUser /> <strong>Owner:</strong> {appointment.name}</p>
                                    <p><FaPhone /> <strong>Phone:</strong> {appointment.phone}</p>
                                    <p><FaEnvelope /> <strong>Email:</strong> {appointment.email}</p>
                                    <p><FaClipboardList /> <strong>Reason:</strong> {appointment.reason}</p>
                                    <p><FaCalendarAlt /> <strong>Date:</strong> {appointment.appointmentDate}</p>
                                    <p><FaClock /> <strong>Time:</strong> {appointment.appointmentTime}</p>
                                </div>
                            ))}
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
};

export default FindVetAppointments;
